/*!50003 SET SESSION SQL_MODE="" */;;
/*!50003 CREATE */ /*!50017 DEFINER=`root`@`localhost` */ /*!50003 TRIGGER `insertGroupsUsers` AFTER INSERT ON `groups_users` FOR EACH ROW BEGIN CALL set_groups_description(NEW.user_id);
END */;;

/*!50003 SET SESSION SQL_MODE="" */;;
/*!50003 CREATE */ /*!50017 DEFINER=`root`@`localhost` */ /*!50003 TRIGGER `updateGroupsUsers` AFTER UPDATE ON `groups_users` FOR EACH ROW BEGIN 
        CALL set_groups_description(NEW.user_id);
        INSERT INTO `groups_users_history` (group_id,user_id,created_on) VALUES (OLD.group_id,OLD.user_id,OLD.created);
END */;;

/*!50003 SET SESSION SQL_MODE="" */;;
/*!50003 CREATE */ /*!50017 DEFINER=`root`@`localhost` */ /*!50003 TRIGGER `deleteGroupsUsers` AFTER DELETE ON `groups_users` FOR EACH ROW BEGIN 
        INSERT INTO `groups_users_history` (group_id,user_id,created_on) VALUES (OLD.group_id,OLD.user_id,OLD.created);
        CALL set_groups_description(OLD.user_id);
END */;;

DELIMITER ;
